import React from "react";
import {FcLike } from "react-icons/fc";

const Card = (props) => {
    let course =props.course;
  return (
    <div className="card">
      <div className="img">
        <img src={course.image.url}></img>

        <div className="like">
          <button>
            <FcLike/>
          </button>
        </div>
      </div>
      <div>
        <p>{course.title}</p>
        <p>{course.description}</p>
      </div>
    </div>
  );
};

export default Card;
